import{_ as e,o as a,c as t,Q as n}from"./chunks/framework.6e0d310a.js";const y=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),o={name:"faq.md"},r=n('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h2 id="what-access-does-teamone-require" tabindex="-1">What access does TeamOne require? <a class="header-anchor" href="#what-access-does-teamone-require" aria-label="Permalink to &quot;What access does TeamOne require?&quot;">​</a></h2><p>When you install TeamOne add-on it will ask you for the next permissions:</p><table><thead><tr><th style="text-align:left;">Permission</th><th>Description</th></tr></thead><tbody><tr><td style="text-align:left;">See your primary Google Account email address</td><td>TeamOne needs your email address to verify the license status. This is the only personal information TeamOne has access to.</td></tr><tr><td style="text-align:left;">Display and run third-party web content in prompts and sidebars inside Google applications</td><td>TeamOne requires permission to display a sidebar and additional screens (within Google Sheets application) to enable its functionality.</td></tr><tr><td style="text-align:left;">Connect to an external service</td><td>TeamOne needs permission to connect to IBM Planning Analytics REST API in order to integrate IBM Planning Analytics data into Google Sheets.</td></tr><tr><td style="text-align:left;">View and manage spreadsheets that this application has been installed in</td><td>TeamOne needs permission to modify the current Google Sheets document, such as adding new tabs and loading data from IBM Planning Analytics. TeamOne cannot access your other documents.</td></tr></tbody></table><p>TeamOne’s use and transfer of information received from Google APIs to any other app will adhere to <a href="https://developers.google.com/terms/api-services-user-data-policy" target="_blank" rel="noreferrer">Google API Services User Data Policy</a>, including the Limited Use requirements.</p><h2 id="do-i-need-to-buy-any-google-subscription-for-teamone" tabindex="-1">Do I need to buy any Google subscription for TeamOne? <a class="header-anchor" href="#do-i-need-to-buy-any-google-subscription-for-teamone" aria-label="Permalink to &quot;Do I need to buy any Google subscription for TeamOne?&quot;">​</a></h2><p>No. Even a free gmail account would work for individual licenses. Though if you purchase a Google Workspace plan, you will be able to install and configure TeamOne for all your users.</p><h2 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-label="Permalink to &quot;Does any server side software need to be installed?&quot;">​</a></h2><p>No. TeamOne lives in Google Cloud and does not require anything to be installed on IBM PA (TM1) server or you computer.</p><h2 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-label="Permalink to &quot;Will any of my data be sent or stored on any 3rd party servers?&quot;">​</a></h2><p>TeamOne connects directly from your browser to IBM Planning Analytics / TM1 server. No data is being sent or stored on any other servers.</p><h2 id="can-teamone-connect-to-ibm-planning-analytics-cloud" tabindex="-1">Can TeamOne connect to IBM Planning Analytics Cloud <a class="header-anchor" href="#can-teamone-connect-to-ibm-planning-analytics-cloud" aria-label="Permalink to &quot;Can TeamOne connect to IBM Planning Analytics Cloud&quot;">​</a></h2><p>Yes, TeamOne can connect to IBM PA cloud. You can configure a Single-Sign-On or use a non-interactive user account.</p><h2 id="what-ibm-planning-analytics-version-is-supported" tabindex="-1">What IBM Planning Analytics version is supported <a class="header-anchor" href="#what-ibm-planning-analytics-version-is-supported" aria-label="Permalink to &quot;What IBM Planning Analytics version is supported&quot;">​</a></h2><p>Even though some functionality may work in the older versions, TeamOne add-on officially supports IBM Planning Analytics version 2.0.9 or newer.</p><h2 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-label="Permalink to &quot;Which TM1 IntegratedSecurityMode does TeamOne support?&quot;">​</a></h2><p>TeamOne supports the next TM1 integrated security modes: 1 (native TM1 security), 4 and 5 (Cognos security)</p>',17),s=[r];function i(d,l,c,h,u,p){return a(),t("div",null,s)}const f=e(o,[["render",i]]);export{y as __pageData,f as default};
